            'kriteria' => 'Jakarta Sepeda Motor Listrik Honda EM1 e: dan juga Honda PCX 160 berduet di paddock Repsol Honda Team (RHT) sebagai kendaraan operasional pebalap dan juga tim pada gelaran balap dunia MotoGP Mandalika. Sebanyak 4 unit Honda EM1 e: dan 2 unit Honda PCX 160 dihadirkan PT Astra Honda Motor (AHM) dengan desain livery spesial Repsol Honda Team (RHT). Kepraktisan sepeda motor listrik Honda beserta matik besar berperforma tinggi ini siap mendukung perjuangan Joan Mir dan Luca Marini, maupun tim dari RHT selama berada di Pertamina Mandalika International Street Circuit.Keenam motor yang didesain khusus dengan dominasi warna biru-merah khas HRC dan sentuhan orange dari Repsol ini menggunakan nomor motor 36 untuk sang juara dunia MotoGP tahun 2020 Joan Mir dan nomor 10 untuk rekan satu timnya Luca Marini. Hal ini juga menjadi momen bersejarah spesial karena untuk pertama kalinya sepeda motor listrik akan wara-wiri di Sirkuit Mandalika selama balapan MotoGP seri Mandalika (28-29/9).Direktur Marketing AHM Octavianus Dwi mengharapan kehadiran Honda EM1 e: dan juga Honda PCX 160 dapat memberikan dukungan mobilitas riders dan tim yang optimal dalam bersaing di MotoGP seri Mandalika.Kesuksesan Honda EM1 e: dalam mengawal beragam kegiatan bergengsi di Tanah Air membuat kami percaya sepeda motor listrik karya anak bangsa ini dapat memenuhi kebutuhan operasional Repsol Honda Team di MotoGP putaran Mandalika tahun ini. Ditemani oleh performa tinggi dari Honda PCX 160, kami ingin memberikan dukungan kepada Joan Mir dan Luca Marini mencetak prestasi yang memberikan inspirasi pada pebalap Tanah Air, ujar Octa.Selain hadir sebagai motor operasional Repsol Honda Team, Honda EM1 e: dan juga Honda PCX160 dengan livery spesial tim Castrol Honda LCR dan Idemitsu Honda LCR juga akan menemani kesibukan aktivitas di paddock Honda LCR sebagai kendaraan operasional Johann Zarco dan juga Takaaki Nakagami beserta tim.Selain pada paddock Sirkuit Mandalika, suasana balap juga dapat langsung dirasakan pengunjung Nusa Tenggara Barat (NTB) sesaat setelah mendarat di Bandar Udara Internasional Zainuddin Abdul Madjid, Praya, Lombok Tengah. Para pengunjung dapat melihat langsung Honda EM1 e: dan juga Honda PCX160 edisi spesial yang dibalut dengan livery Repsol Honda Team (RHT) di pintu kedatangan.Honda EM1 e: menjadi sepeda motor listrik berkualitas tinggi yang memiliki performa halus dan responsif layaknya sensasi menggunakan sepeda motor konvensional yang dihasilkan oleh motor penggerak dengan tenaga maksimal 1,7 kW. Dukungan baterai MPP e: yang dapat dilepas-pasang (detachable) turut memberikan kemudahan konsumen. Pengisian daya dapat dilakukan dengan Honda Power Pack Charger e: dengan waktu pengisian daya 2,7 jam (160 menit) untuk 25%-75% dan 6 jam untuk 0%-100%. Baterai MPP e: memiliki perlindungan IP65 yang membuat baterai ini tahan dari debu dan siraman air dari segala arah, serta memiliki standarisasi internasional UNR 136 sehingga memastikan jaminan kualitas dan keamanan baterai MPP e:.Sementara itu Honda PCX160 hadir dengan performa mesin 160cc mumpuni yang mampu menghasilkan tenaga maksimal hingga 11,8 kW @8500 rpm dengan torsi puncak 14,7 Nm @6500 rpm. Cocok untuk digunakan berkendara di perkotaan maupun turing jarak jauh. Keseluruhan varian Honda PCX160 telah disematkan Honda Smart Key yang dilengkapi alarm dan answer back system pada semua tipe, sehingga memberikan kebanggaan serta tampilan berkelas untuk memenuhi kebutuhan gaya hidup berkendara sehari-hari.',
