            'image' => 'img/articles4.webp',
            'name' => 'Pentingnya Nutrisi dan Peran Orang Tua dalam Tumbuh Kembang Anak',
            'kriteria' => 'Jakarta- Dua pebalap Astra Honda tampilkan performa balap penuh perjuangan yang kencang dan impresif saat berbagi lintasan dengan pebalap kelas dunia lainnya, pada ajang Mandalika GP melalui gelaran Idemitsu Asia Talent Cup (IATC) 2024 yang digelar di Pertamina Mandalika International Circuit, Lombok, Nusa Tenggara Barat (28-29/09). Di tengah persaingan balap yang ketat, pebalap Muhammad Kiandra Ramadhipa tetap berhasil mengokohkan posisi tiga besar klasemen sementara dan pebalap wildcard Davino Britani mampu menunjukkan performa perdananya langsung di jajaran 10 besar pebalap utama sepanjang balapan berlangsung.Sebagai tuan rumah, dua pebalap Astra Honda Racing Team (AHRT) ini berhasil tampil impresif menunjukkan perjuangan kerasnya bersaing dengan pebalap lainnya untuk meraih hasil terbaik. Tampil pada race pertama, Ramadhipa nyaris meraih podium pada balapan yang digelar pada Sabtu (28/09). Memulai start dari posisi kelima, pebalap 15 tahun tersebut berhasil mempertahankan posisinya untuk terus berada di grup terdepan. Tetapi sayang sekali memasuki lap akhir, terjadi crash yang melibatkan pebalap lainnya. Ramadhipa yang berhasil finish di posisi ketiga, mendapatkan pinalti pengurangan 6 detik sehingga belum dapat meraih podium. Sedangkan di race kedua persaingan ketat tidak dapat dihindari. Beberapa kali melakukan overtake, Ramadhipa sempat keluar dari lintasan dan harus puas finish di posisi ke 17. Meski belum berhasil mempersembahkan podium, Ramadhipa berhasil mempertahankan klasemen sementara di posisi ketiga di ajang IATC 2024, dengan perolehan 81 poin.Saya berupaya tampil maksimal dan meraih poin di balapan home race belum dapat terlaksana. Di race pertama terjadi insiden sehingga terjadi pengurangan poin, sedangkan race kedua saya mengalami highside. Meski belum dapat meraih poin di race 2, paling tidak posisi klasemen kejuaraan sementara saya masih berada di top 3. Saya akan berupaya tampil lebih baik lagi menghadapi seri IATC selanjutnya, ujar Ramadhipa.Sementara pebalap lainnya di ajang IATC 2024 yaitu Davino Britani, turun perdana sebagai pebalap wildcard. Davino berupaya tampil memukau selama dua race. Davino menunjukkan skill balap yang impresif sejak sesi free practice, qualifikasi, hingga race. Di race pertama Davino berhasil finish di posisi ke 13 setelah terjadi crash ketika balapan IATC tersebut berlangsung. Sedangkan di race kedua, Davino mendapatkan pengalaman berharga lainnya. Meskipun telah berupaya dan sempat berada di top 6, pebalap berusia 14 tahun tersebut mengalami insiden sesaat sebelum garis finish, sehingga tidak dapat menyelesaikan jalannya balapan.Saya sangat senang mendapatkan kesempatan menjadi pebalap wildcard di ajang IATC 2024, terlebih hal ini merupakan pengalaman perdana di IATC. Terima kasih atas kesempatan yang telah diberikan oleh Astra Honda Motor, serta dukungan yang diberikan oleh keluarga, sponsor, dan kerabat semuanya, ujar Davino.Meramaikan gelaran balap terbesar di Indonesia, PT Astra Honda Motor (AHM) juga menurunkan pebalap binaannya, Fadillah Arbi Aditama sebagai wildcard di kelas Moto3 World Championship. Pebalap Astra Honda Racing Team tersebut mengunci posisi start ke-21 pada Grand Prix Indonesia yang merupakan wildcard terakhirnya pada musim 2024. Pebalap dengan nomor motor 93 ini memulai balapan dari baris ke-8. Meskipun belum dapat meraih poin dikarenakan terjatuh dan tidak menyelesaikan balapan, Arbi tetap optimis menjadikan balapan kali ini sebagai pengalaman berharga.Saya berupaya maksimal mungkin untuk dapat meraih poin pada balapan wildcard di seri Mandalika GP tahun ini. Saya berupaya melakukan overtake beberapa kali untuk melewati pebalap lainnya, tetapi sangat disayangkan saya mengalami high side sehingga tidak dapat melanjutkan jalannya balapan. Terima kasih atas pengalaman berharga dan kesempatan yang telah diberikan oleh AHM, saya akan menjadikan hal ini bekal untuk tampil di ajang balap kejuaraan JuniorGP selanjutnya, ujar Arbi yang merupakan pebalap regular di ajang balap FIM Junior GP yang dilaksanakan di benua Eropa.Selain ketiga pebalap tersebut, alumni Astra Honda Racing School lainnya yang juga pebalap binaan Astra Honda, Mario Suryo Aji juga turun sebagai pebalap regular di ajang kejuaraan FIM Moto2 World Championship 2024 bersama dengan Honda Team Asia. Kelas Moto2 sendiri merupakan kelas balap satu tingkat di bawah kelas MotoGP. Tahun ini merupakan tahun pertama Mario turun sebagai pebalap regular di kelas FIM Moto2 World Championship 2024. Perdana tampil di hadapan masyarakat Indonesia pada kelas Moto2 tahun ini, Mario berhasil menunjukkan skill balapnya dan bersaing dengan pebalap dari berbagai negara lainnya. Sebelumnya, pebalap yang merupakan alumni Astra Honda Racing School tahun 2016 ini juga jebolan dari ajang Idemitsu Asia Talent Cup. Sebelum bersaing di kelas Moto2, Mario merupakan pebalap Moto3 selama dua tahun pada 2022-2023.General Manager Marketing Planning and Analysis AHM Andy Wijaya mengatakan, AHM berkomitmen mendukung mimpi pebalap muda Indonesia untuk mampu berlaga di kejuaraan internasional hingga berbagi panggung di ajang balap dunia MotoGP. Semoga perjuangan di sirkuit Mandalika ini menjadi pemacu semangat bagi para pebalap muda untuk terus semangat mewujudkan cita-cita dan mengharumkan nama Indonesia di kancah balap dunia.',
            'booking' => '/articles/Pentingnya Nutrisi dan Peran Orang Tua dalam Tumbuh Kembang Anak'
