            'image' => 'img/articles6.webp',
            'name' => 'SiKecil Sulit Fokus Mengenal Lebih Dekat Tanda-Tanda ADHD',
            'kriteria' => 'Jakarta Sebanyak 4.590 mahasiswa dari 29 perguruan tinggi di berbagai provinsi Indonesia berinteraksi secara aktif dan seru dalam kegiatan seminar keselamatan berkendara dengan tema Slow Down, Life Up sepanjang bulan September 2024. Kegiatan yang digelar PT Astra Honda Motor (AHM) bersama jaringan main dealer di seluruh Tanah Air ini mengajak ribuan anak muda untuk bersama-sama mewujudkan budaya keamanan, kenyamanan dan keselamatan berkendara di jalan raya.Dalam seminar dan diskusi ini, para mahasiswa menambah wawasan sekaligus saling berbagi rahasia cara unik mereka untuk meningkatkan keselamatan saat mengendarai sepeda motor di jalan raya, terutama dalam mengatur kecepatan.Berdasarkan riset internal AHM, saat ini kecepatan tinggi menjadi penyebab kecelakaan lalu lintas tertinggi di kalangan anak muda. Sehingga, diskusi ini mengajak ribuan mahasiswa untuk lebih peka dalam berkendara dengan memiliki pemahaman bahwa semakin tinggi kecepatan maka berbanding lurus dengan tingginya resiko kecelakaan di jalan. Selain itu, penyusunan rencana perjalanan juga menjadi salah satu hal penting yang perlu dilakukan guna meminimalisir resiko perjalanan karena terburu-buru saat menuju tempat tujuan. Pemahaman rambu-rambu lalu lintas juga berdampak dalam pengaturan kecepatan sesuai dengan kondisi jalan, serta pentingnya pengendara sepeda motor untuk tetap mengutamakan keselamatan dalam setiap pengambilan keputusan saat berkendara.Diskusi interaktif para mahasiswa dari berbagai pulau ini semakin spesial dengan hadirnya instruktur safety riding Honda yang berbagi ilmu keselamatan berkendara, termasuk pentingnya berkendara dengan kelengkapan surat-surat berkendara. Dalam sesi ini, peserta juga mendapat wawasan lebih luas dari perwakilan Kekriteriasian Republik Indonesia di setiap wilayah.Pembelajaran bukan hanya seputar kondisi berkendara di jalan raya, namun AHM dan jaringannya juga bekerjasama dengan Jasa Raharja dalam memberikan pemaparan edukasi asuransi kecelakaan bagi pengguna sepeda motor. Untuk menambah sisi interaksi dan seru khas anak muda, para intruktur AHM juga memberikan edukasi melalui simulasi berkendara yang dilakukan di sekitar area kampus.General Manager Marketing Planning and Analysis AHM Andy Wijaya menyampaikan kepekaan terhadap keselamatan berkendara di jalan raya bagi anak muda sangat penting untuk terus diasah, sehingga generasi penerus bangsa ini tidak hanya memiliki kepedulian namun juga dapat menjadi bagian dari budaya berkendara yang aman dan menyenangkan di jalan.Kegiatan edukasi keselamatan berkendara bersama ribuan mahasiswa yang interaktif dan saling berbagi rahasia keselamatan berkendara khas anak muda diharapkan dapat mendukung gaya hidup berkendara mereka yang nyaman, aman dan selamat di jalan raya, ujar Andy.Gelaran edukasi keselamatan berkendara ini juga dimeriahkan dengan program-program kuis menarik berhadiah jutaan rupiah bagi peserta pelatihan. Hadir di setiap provinsi di Indonesia, program edukasi keselamatan berkendara di kampus ini dimulai dari sisi barat Indonesia, yakni Universitas Teuku Umar, Meulaboh, Aceh hingga bagian Timur Indonesia yakni Universitas Cendrawasih Jayapura, Papua.',
